import React from 'react';
import { Link, Outlet } from 'react-router-dom';

export default function App() {
   return (
      <div>
         <h1>Apple Core</h1>
         <nav>
            <Link to="/routes/Mac">Mac</Link>
            <Link to="/routes/IMac">iMac</Link>
            <Link to="/routes/MacBook">MacBook</Link>
            <Link to="/routes/IPad">iPad</Link>
            <Link to="/routes/IPhone">iPhone</Link>
            <Link to="/routes/AirPods">AirPods</Link>
            <Link to="/routes/TVandHome">TVandHome</Link>
            <Link to="/routes/Watch">Watch</Link>
         </nav>
         <Outlet />
      </div>
   );
}
